import React, {Component} from 'react';

class UploadBackground extends Component {


  render() {
    return (
      <div style={{'display':'none', 'zIndex':'10', 'position':'absolute', 'top':'0', 'left':'0', 'right':'0','bottom':'0', 'background':'red' }}>123</div>
    )
  }
}

export default UploadBackground;
